description:
The skies are a whole lot friendlier when a group of the world's most beautiful porn stars pose as slutty flight attendants and sneak onto a plane to shoot a reality show. Cleared for take-off, the Captain leaves the real stewardesses detained in security. Sex erupts aboard the flight, and the horny bliss proves too much for the weak-hearted pilot. Not it's up to Digital Playground's girls to land the plane to safety.

